import React from "react"
import { Card } from "react-bootstrap";
import '../../public/css/bootstrap.css'

const Page = () => {
    return (
        <div className="container mt-4">
            <Card className="mb-4">
                <Card.Img variant="top" src='' alt='' />
                <Card.Body>
                    <Card.Text>
                        <strong>Authors:</strong>
                    </Card.Text>
                    <Card.Text>
                        <strong>Authors:</strong>
                    </Card.Text>
                    <Card.Text>
                        <strong>Description:</strong>
                    </Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
};

export default Page;
